import React, { Component } from 'react';
import Checkedd from './components/checkbox';

class Homework extends Component {
    constructor(props) {
        //create state
        super(props);
        this.state = {
            
        };
    }
    

    render() {
       

        return (
            <div className="bigcard" >
            <h3>Homework</h3>
            <div style={{display:"flex", flexDirection:"column"}}>
               <Checkedd state={this.props.state} student={this.props.state.currentstudent} handleChange={this.props.handleChange} dispatch={this.props.dispatch}/>
               {this.props.state.currentstudent.homeworks.map((homework, index) => <div key={index}>{homework} </div>)}
            </div>
            </div>

               
        );
    }
}

export default Homework;
